import PropTypes from "prop-types"

function Item({marca, lancamento}) {
    return(
        <>
        <li>{marca} - {lancamento}</li>
        </>
    )
}

Item.propTypes = {
    marca: PropTypes.string.isRequired,
    lancamento : PropTypes.number
}

Item.defaultProps = {
    marca: `Favor informar uma marca`,
    lancamento: 0
}

export default Item
